import React from "react";

import './FooterStyling.css'

import linkedinLogo from "../resources/linkedin.png"
import instagramLogo from "../resources/instagram.png"

function Footer()
{
    return (
        <div className="Footer">
            <a href="https://www.linkedin.com/in/kaylea-gray-7277a21b6/"><img className="logo_medium" src={linkedinLogo} alt="Kaylea Gray Linkedin"/></a>
            <a href="https://www.instagram.com/miss_kaylea_reads/"><img className="logo_small" src={instagramLogo} alt="Miss Kaylea Reads Instagram"/></a>
        </div>
    );
}

export default Footer;
